const arr = ['apple', 'Banana', 'kiwi', 'Avocado'];
arr.sort((a, b) => a.localeCompare(b, undefined, { sensitivity: 'case' }));
console.log(arr);
// Output: ["apple", "Banana", "Avocado", "kiwi"]
