You can't change the background color of an Adaptive Card. Adaptive Cards are designed with accessibility in mind, and they adapt to the host application's UI style. The color contrast you see in the Bot Framework Emulator is the default style for Adaptive Cards in Emulator. If you are using Web Chat or any other channel, the Adaptive Card will adapt to the UI style of that channel.
